import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on the account dropdown
    await page.waitForSelector('.account-lists', { timeout: 5000 });
    await page.hover('.account-lists');

    // Wait for dropdown to appear and click on Your Profile
    await page.waitForSelector('.dropdown-content', { timeout: 5000 });
    await page.click('.dropdown-content a:has-text("Your Profile")');

    // Wait for profile page to load
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    // Extract profile information
    const username = await page.textContent('.username');
    const fullName = await page.textContent('.profile-info h2');
    const bio = await page.textContent('.bio');

    return {
      success: true,
      action: "Navigated to Jun's Profile",
      extractedData: {
        username: username ? username.trim() : null,
        fullName: fullName ? fullName.trim() : null,
        bio: bio ? bio.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
